import { store } from './App';

const Profile = () => {
  store.dispatch({ type: { loc: 'profile' } });

  const content = new Array(6).map((e, idx) => (
    <>
      <table>
        <thead className="main-profile-content-thead">
          <tr>
            <td>1</td>
          </tr>
        </thead>
        <tbody className="main-profile-content-tbody">
          <tr>
            <td>2</td>
          </tr>
        </tbody>
        <tfoot className="main-profile-content-tfoot">
          <tr>
            <td>3</td>
          </tr>
        </tfoot>
      </table>
    </>
  ));

  return (
    <div className="main-profile-wrapper">
      <div className="main-profile-content"></div>
    </div>
  );
};

export default Profile;
